// src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import TextModernizer from "./components/TextModernizer";
import CommentaryGenerator from "./components/CommentaryGenerator";
import SearchFeature from "./components/SearchFeature";
import Quiz from "./components/Quiz";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<h1>Home</h1>} />
        <Route path="/modernize" element={<TextModernizer />} />
        <Route path="/commentary" element={<CommentaryGenerator />} />
        <Route path="/search" element={<SearchFeature />} />
        <Route path="/quiz" element={<Quiz />} />
      </Routes>
    </Router>
  );
};

export default App;
